import React from "react";

const Header = () => {
  var primary = "FF9ff";
  return (
    <div className="w-100 max-width: 1280px flex justify-center md:justify-between">
      <div className="center logo">
        <img src="/images/logo.png" className="w-20"></img>
      </div>
      <div className="hidden md:flex">
        <div className="justify-self-center md:align-self-auto flex">
          <li>Home</li>
          <li>Home</li>
          <li>Home</li>
          <li>Home</li>
        </div>
        <div className="h-10  bg-primary ">Book Appointment</div>
      </div>
    </div>
  );
};

export default Header;
